const PERIOD = 0.002;

function convertBinaryStringToUint8Array(str) {
    let len = str.length;
    let array = new Uint8Array(len);
    for (let i = 0; i < len; i++) {
        array[i] = str.charCodeAt(i);
    }
    return array;
}

const buffer = Buffer.allocUnsafe(4);
function readFloat(data, i) {
    buffer[0] = data[i];
    buffer[1] = data[i + 1];
    buffer[2] = data[i + 2];
    buffer[3] = data[i + 3];
    return buffer.readFloatLE(0);
}

const arr = convertBinaryStringToUint8Array(msg.payload.data);
const values = [];
for (let i = 0; i < arr.length; i += 4) {
    values.push(readFloat(arr, i));
}

let state = 0;
let t0;
let t1;
let t2;
let t3;
for (let i = 0; i < values.length; i++) {
    const value = values[i];
    if (state == 0) {
        if (value < 0.1) {
            t0 = i;
            state = 1;
        }
    } else if (state == 1) {
        if ((i - t0) * PERIOD > 0.1) {
            state = 2;
        } else if (value > 0.5) {
            state = 0;
        }
    } else if (state == 2) {
        if (value > 0.5) {
            t1 = i;
            state = 3;
        }
    } else if (state == 3) {
        if (value < 0.1) {
            t2 = i;
            state = 4;
        }
    } else if (state == 4) {
        if (value > 0.5) {
            t3 = i;
            state = 5;
        }
    }
}

let frequency = 0;
let duty = 0;
if (state == 5) {
    frequency = (t3 - t1) * PERIOD;
    duty = 100 * (t2 - t1) / (t3 - t1);
}

msg.payload = { frequency, duty };

return msg;

